```

6. Make HTTP requests from your React app:

In your React app, you can use Axios to make HTTP requests to your Express.js server. For example, to retrieve data:
```javascript
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios('/api/data');
      setData(result.data);
    };
    fetchData();
  }, []);

  return (
    // Render your data here
  );
